import { SectionHeading } from "../styles/SectionHeading.styled";
export const ProjectSection = () => {
  return (
    <>
      <StyledProjectSection>
        <SectionHeading>
          <h1>Projects</h1>
        </SectionHeading>
      </StyledProjectSection>
      <hr />
    </>
  );
};
